<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tic Tac Toe</title>
    <link rel="stylesheet" href="/style.e308ff8e.css">
  <script src="/style.e308ff8e.js"></script></head>
  <body>
    <nav>
      <ul>
        <li>TicTacToe</li>
      </ul>
    </nav>
    
    <div class="gamedetails welcome">
      <h1>Welcome to the game...! Player 1 starts with 'X' and the other with 'O'</h1>
    </div>
    <div class="X1" style="left: 5vw;">X</div>
    <div class="boxx1"></div>
    <div class="X2" style="left: 10vw;">O</div>
    <div class="boxx2"></div>
    <div class="X3" style="left: 15vw;">X</div>
    <div class="boxx3"></div>
    <div class="X4" style="left: 20vw;">O</div>
    <div class="boxx4"></div>
    <div class="X5" style="left: 25vw;">X</div>
    <div class="boxx5"></div>
    <div class="X6" style="left: 30vw;">O</div>
    <div class="X7" style="left: 43vw;">X</div>
    
    <div class="complete">
      <div class="container">
        <div class="container_one">
            <div class="line"></div>
          <div class="gamedetails images1">
            <img class="two" src="/youwon.fdae97f6.gif" alt="">
          </div>
          <div class="game">
            <div class="box bt-0 bl-0"><span class="inputtext"></span></div>
            <div class="box bt-0"><span class="inputtext"></span></div>
            <div class="box br-0 bt-0"><span class="inputtext"></span></div>
            <div class="box bl-0"><span class="inputtext"></span></div>
            <div class="box"><span class="inputtext"></span></div>
            <div class="box br-0"><span class="inputtext"></span></div>
            <div class="box bl-0 bb-0"><span class="inputtext"></span></div>
            <div class="box bb-0"><span class="inputtext"></span></div>
            <div class="box bb-0 br-0"><span class="inputtext"></span></div>
          </div>
          <div class="gamedetails images2">
            <img class="one" src="/you won.a63abeab.gif" alt="">
          </div>
        </div>
        <div class="gamedetails container_two">
          <div>
            <span class="info">X's turn</span>
          </div>
          <div>
            <button class="reset">Reset</button>
          </div>
        </div>
      </div>
    </div>
    <script src="/script.75da7f30.js" ;=""></script>
  </body>
</html>
